Love hearts? &hearts;  

These beautiful heart earrings are made with silver plated heart drops that are accented with a 6mm Swarovski Crystal AB rondelle.  

These earrings have sterling silver ear wires for those with sensitive ears. 

Earrings dangle 2 inches long.

These earrings are modeled on my home page so check it out &#12483;

This exclusive sterling silver ring set includes a Kinked and an Amour ring.  These rings are great for stacking together or worn separately.  They are even small enough to also be worn as knuckle rings. 

Ring size for both are approximately 3&frac12; 

Each ring has been hand formed, soldered and textured using the finest .925 sterling silver wire.  These rings have also been polished in a tumbler for added shine and durability.

&hearts; Love the beach?  Then this is for you. &hearts;

This necklace is made with a 14 gauge sterling silver free formed heart charm that has been soldered, textured and polished by hand.  The heart is adorned with a unique cone shell that was found by me from one of Hawaii's beautiful beaches.  All other components are made with sterling silver.

The chain measures approximately 32 inches long.

